import React, {useState} from 'react';
import axios from 'axios'

const Home = () => {
    useEffect(() => {
        axios.get('https://jsonplaceholder.typicode.com');
    });
    return(
        <div className="container">
            <h4 className="centers">Home</h4>
            <p>This is a random paragraph!</p>
        </div>
    )
}

export default Home;
